import React, { Component } from "react";
import { Form } from "react-bootstrap";
import { GoogleLogin } from "react-google-login";

export const SignIn = () => {
  return (
    <Form id="signIn">
      <h3>Sign In</h3>

      <GoogleLogin />
    </Form>
  );
};
